PREFIX wdt: <http://www.wikidata.org/prop/direct/>
PREFIX rdfs: <http://www.w3.org/2000/01/rdf-schema#>
PREFIX xsd: <http://www.w3.org/2001/XMLSchema#>
PREFIX wd: <http://www.wikidata.org/entity/>
SELECT ?senator ?label WHERE {
  ?senator wdt:P39 wd:Q11611 .
  ?senator wdt:P580 ?start .
  FILTER ( ?start >= "2013-01-01" ^^ xsd:date && ?start <= "2013-12-31" ^^ xsd:date ) OPTIONAL {
    ?senator wdt:P582 ?end .
    FILTER ( ?end > "2013-12-31" ^^ xsd:date )
  }
  FILTER ( NOT EXISTS {
    ?senator wdt:P582 ?end2 .
    FILTER ( ?end2 < "2014-01-01" ^^ xsd:date )
  }
  ) ?senator rdfs:label ?label .
}
ORDER BY ?label

